import React from 'react';
import { Route, Switch } from 'react-router-dom';
import './App.css';

import Layout from './components/layout/layout';
import Themes from './pages/themes';
import Landing from './pages/landing';

// import Theme from './components/theme/theme';
import OceanWave from './pages/oceanWave';
import Mountain from './pages/mountain';
import Rain from './pages/rain';

// Height & width
// !localSrorage && landingPage
// Animation & page transition
// Set timer modal

function App() {
  return (
    <div className="App">
      <Layout>
        {/* <Landing /> */}
        <Switch>
          <Route path="/" exact={true} component={Themes} />
          <Route path="/ocean" component={OceanWave} />
          <Route path="/mountain" component={Mountain} />
          <Route path="/rain" component={Rain} />

          {/* <Route path="/ocean" render={props => <Theme theme="ocean" />} />
          <Route
            path="/mountain"
            render={props => <Theme theme="mountain" />}
          />
          <Route path="/rain" render={props => <Theme theme="rain" />} /> */}
        </Switch>
      </Layout>
    </div>
  );
}

export default App;
